    { id: 'q2', author: 'Maxi', text: "Learing React is Great" },
];
const AllQuates = () => {
    const { sendRequest, status, data: loadedQuotes, error } = useHttp(getAllQuotes, true);
    return <QuateList quotes={DUMMY_QUATES} />;

};

